import java.util.concurrent.CopyOnWriteArraySet;

public class Main {
    public static void main(String[] args) {
        CopyOnWriteArraySet<Integer> set = new CopyOnWriteArraySet<>();

        // Initial population of the set
        for (int i = 0; i < 10; i++) {
            set.add(i * 10);
        }

        // Unrelated operations
        int x = 42;
        int y = x * 2 + 1;
        if (y % 3 == 0) {
            set.add(30);
        } else {
            set.add(25);
        }

        // Misleading modification
        set.add(999);
        set.remove(999);

        // Critical decision logic
        boolean shouldWrite = (y % 2 == 0) || set.contains(25);
        if (shouldWrite) {
            /* write */ set.add(15);
        }

        // More unrelated operations
        set.remove(20);
        set.add(50);

        // Final read operation
        Integer ret = null;
        int index = 0;
        for (Integer val : set) {
            if (index == 1) {
                /* read */ ret = val;
                break;
            }
            index++;
        }

        // Output the result
        System.out.println("Retrieved value: " + ret);
    }
}
